import React from "react";

const Task = ({
  id,
  text,
  onDeleteItem,
  onUpdatePriority,
  onUpdateCompited
}) => {
  return (
    <div>
      <p>{text}</p>
      <button onClick={onDeleteItem}>Delete</button>
      <select
        name="priority"
        onChange={e => onUpdatePriority(id, e.target.value)}
      >
        <option value="Low">Low</option>
        <option value="Normal">Normal</option>
        <option value="Hight">Hight</option>
      </select>
      <input type="checkbox" checked="complited" onChange={onUpdateCompited} />
    </div>
  );
};

export default Task;
